import React from "react";
import { useState } from "react";
import { FormProps } from "../types/data";

const Form: React.FC = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  return (
    <div className="flex flex-col max-w-36 items-center justify-center">
      Authentificate
      <input
        className="w-32 h-14 flex items-center justify-center border-2 mt-4"
        type="email"
        value={email}
        onChange={(e) => setEmail(e.target.value)}
        placeholder="email"
      />
      <input
        className="w-32 h-14 flex items-center justify-center border-2 mt-4"
        type="password"
        value={password}
        onChange={(e) => setPassword(e.target.value)}
        placeholder="password"
      />
      <button
        className="w-32 h-14 border-2 mt-4"
        onClick={() => console.log(email, password)}
      >
        Submit
      </button>
    </div>
  );
};

export default Form;
